import React from 'react';
import './App.css';

function App() {
  //console.log(fetch(`https://svc.metrotransit.org/nextripv2/routes`));
  fetch(`https://svc.metrotransit.org/nextripv2/routes`).then(
    resp => resp.json()// this returns a promise
  ).then(repos => {
      console.log(repos);
  }).catch(ex => {
    console.error(ex);
  })
  return (
    <div className="App">
      <select className="select-box">
        <option>Select</option>
      </select>
    </div>
  );
}

export default App;
